 import React from "react";

const TripList = ({ trips }) => {
  if (!trips?.length) return <p>Nessun viaggio disponibile.</p>;

  return (
    <div className="mt-3">
      <h4>I tuoi Viaggi</h4>
      <ul className="list-group">
        {trips.map((trip) => (
          <li key={trip._id} className="list-group-item">
            <strong>{trip.title}</strong> - {trip.destination}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TripList;
